Considerando o Art. 2º d a Portaria nº 16/2025, de 23 de janeiro de 2025, que dispõe sobre a Política de Representação Institucional do CRP-06 e dá outras providências:

São tipologias de representações institucionais finalísticas de caráter permanente ou eventual:

Representações em órgãos de controle e participação social das quais o CRP-06 tenha cadeira permanente ou elegível;

Fóruns e Movimentos Sociais devidamente nomeados;

Comitês de Ética em Pesquisa devidamente nomeados;

Entidades da Psicologia devidamente nomeadas;

Audiências Públicas, Congressos, Seminários, Eventos de interesse do CRP-06, reuniões com Instituições Públicas ou Privadas devidamente nomeadas;

Formação técnica e administrativa;

Espaços do Sistema Conselhos de Psicologia devidamente nomeados;

Outras atividades não ordinárias alinhadas ao plano estratégico e relacionadas com as atividades finalísticas devidamente nomeadas e aprovadas pela vice-presidência do CRP-06.

- O prazo para a entrega e instalação do material será de até 90 (noventa) dias, a contar do primeiro dia útil subsequente ao recebimento da Nota de Empenho, os quais deverão ser entregues nos endereços de instalação indicados no Termo de Referência;
- A Contratada deverá apresentar o prazo de garantia mínima de 12 (doze) meses dos produtos, a contar da data da efetiva instalação, devendo substituir, às suas expensas, quaisquer materiais que apresentem defeitos ou vícios, desde que não tenham sido comprovadamente causados por mau uso;
- Dentre os requisitos técnicos, os equipamentos deverão possuir plataforma computadorizada e microprocessada capaz de combinar todas as funções de processamento de imagem e demais requisitos do funcionamento do sistema. A tecnologia deverá possibilitar a identificação de materiais suspeitos, como explosivos, narcóticos e objetos de alta densidade. Os diferentes tipos de materiais deverão ser apresentados distintamente com cores. Possuir sistema próprio de identificação de materiais orgânicos, inorgânicos e misturados, com cores diferenciadas.
